import React from 'react';
import axios from 'axios';

class App extends React.Component {

	state = {
		details : [],
	}

	componentDidMount() {

		let data ;

		axios.get('http://localhost:8000/api/demos/')
		.then(res => {
			data = res.data;
			this.setState({
				details : data
			});
		})
		.catch(err => {})
	}

render() {
	return(
	<div>
			{this.state.details.map((id, first_name) => (
			<div>
				<div>
						<h1>{first_name} </h1>
				</div>
			</div>
			)
		)}
	</div>
	);
}
}

export default App;
